import './App.css';
import React, { useEffect } from 'react';
import axios from 'axios';
import Layout from './hoc/Layout/Layout';
import { Route, Switch } from 'react-router-dom';
import Produce from './containers/Products/Produce/Produce';
import Frozen from './containers/Products/Frozen/Frozen';
import Deli from './containers/Products/Deli/Deli';
import Bakery from './containers/Products/Bakery/Bakery';
import Home from './containers/Home/Home';
import * as actionTypes from './store/actions';
import { connect } from 'react-redux';


class App extends React.Component {

  /* useEffect(() => {
      axios.get('http://localhost:3005/products')
      .then(response => {
          console.log(response);
          props.onInitProducts(response);
      })
      .catch(err => console.log(err))
  }, []) */
  componentDidMount() {
    axios.get('http://localhost:3005/products')
      .then(response => {
          console.log(response.data);
          this.props.onInitProducts(response.data);
      })
      .catch(err => console.log(err))
  }

  render() {
    return (
      <div className="App">
        <Layout>
          <Switch>
            <Route path="/" exact component={Home}/>
            <Route path="/Produce" component={Produce}/>
            <Route path="/Frozen" component={Frozen}/>
            <Route path="/Deli" component={Deli}/>
            <Route path="/Bakery" component={Bakery}/>
          </Switch>
        </Layout>
      </div>
    );
  }


}

const mapDispatchToProps = dispatch => {
    return {
      onInitProducts: (productsArr) => dispatch({type: actionTypes.INIT_PRODUCTS(productsArr)})
    }
}

export default connect(null, mapDispatchToProps)(App);
